def load_qcd_sf(channel, met):
    import os
    base = os.path.join(os.environ['STPOL_DIR'], 'qcd_estimation', 'fitted', channel)
    fn = base + '/2j1t_no_MC_subtraction_mt_%s_plus.txt' % met
    fi = open(fn)
    li = fi.readline().strip().split()
    sf = float(li[0])
    return sf

